import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Todolist.css';
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

toast.configure();

const Todolist = () => {
  const [tasks, setTasks] = useState([]);
  const [taskName, setTaskName] = useState('');
  const [startTime, setStartTime] = useState('');
  const [endTime, setEndTime] = useState('');

  useEffect(() => {
    axios.get('/api/tasks')
      .then(response => setTasks(response.data))
      .catch(error => console.error('Error fetching tasks:', error));
  }, []);

  const handleAddTask = () => {
    const newTask = { taskName, startTime, endTime, completed: false };
    axios.post('/api/tasks', newTask)
      .then(response => {
        setTasks([...tasks, response.data]);
        toast.success('Task added successfully!');
        setTaskName('');
        setStartTime('');
        setEndTime('');
      })
      .catch(error => toast.error('Error adding task: ' + error.message));
  };

  const handleDeleteTask = (id) => {
    axios.delete(`/api/tasks/${id}`)
      .then(() => {
        setTasks(tasks.filter(task => task.id !== id));
        toast.success('Task deleted successfully!');
      })
      .catch(error => toast.error('Error deleting task: ' + error.message));
  };

  const handleCompleteTask = (id) => {
    axios.put(`/api/tasks/${id}`, { completed: true })
      .then(() => {
        setTasks(tasks.map(task => (task.id === id ? { ...task, completed: true } : task)));
        toast.success('Task marked as completed!');
      })
      .catch(error => toast.error('Error updating task: ' + error.message));
  };

  return (
    <div className="todo-container">
      <div className="task-form">
        <h2>Add New Task</h2>
        <input
          type="text"
          placeholder="Task Name"
          value={taskName}
          onChange={(e) => setTaskName(e.target.value)}
        />
        <input
          type="datetime-local"
          placeholder="Start Time"
          value={startTime}
          onChange={(e) => setStartTime(e.target.value)}
        />
        <input
          type="datetime-local"
          placeholder="End Time"
          value={endTime}
          onChange={(e) => setEndTime(e.target.value)}
        />
        <button onClick={handleAddTask}>Add Task</button>
      </div>
      <div className="task-lists">
        <div className="task-list remaining-tasks">
          <h2>Remaining Tasks</h2>
          <ul>
            {tasks.filter(task => !task.completed).map(task => (
              <li key={task.id}>
                <span>{task.taskName} (Start: {task.startTime}, End: {task.endTime})</span>
                <button onClick={() => handleCompleteTask(task.id)}>Complete</button>
                <button onClick={() => handleDeleteTask(task.id)}>Delete</button>
              </li>
            ))}
          </ul>
        </div>
        <div className="task-list completed-tasks">
          <h2>Completed Tasks</h2>
          <ul>
            {tasks.filter(task => task.completed).map(task => (
              <li key={task.id}>
                <span>{task.taskName} (Start: {task.startTime}, End: {task.endTime})</span>
                <button onClick={() => handleDeleteTask(task.id)}>Delete</button>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Todolist;
